import styled from "styled-components";

export const CardList = styled.div`
	display: flex;
	flex-direction: row;
	flex-wrap: wrap;
`;

export const CardProduct = styled.div`
	background-color: chartreuse;
	max-width: 23%;
	display: flex;
	flex-direction: column;
	margin: 1rem;
`;
